function UpperSec(props) {
  return (
    <>
      <div className="container-fluid">
        <div className="row some text-center">
          <div className="col">
            <p>--Category Name</p>
          </div>
          <div className="col text-right">
            <p>--Search Icon</p>
          </div>
        </div>
      </div>
    </>
  );
}

function RowLayout(props) {
  return (
    <>
      <div className="container-fluid">
        <ul className="listStyleNone">
            <li key="upperSection">{UpperSec}</li>
            <li key="mainSection">{booksOfCategory}</li>
        </ul>
      </div>
    </>
  );
}

function Layout(props) {
  var emptyList = [];
  const _count = parseInt(props.count);
  console.log(_count);
  for (let i = 0; i < _count; i++) {
    emptyList.push(<li key={i}>{layout}</li>);
  }
  return (
    <>
      <ul className="listStyleNone">{emptyList}</ul>
    </>
  );
}

export default Layout;
